Great Planes

Technology, War Documentary hosted by Paul Moga, published by Military Channel in 2009 - English narration


Information
------------------------------

Get inside the combat aircraft that survived the most dangerous missions and see why they were the greatest and most influential weapons in our military history. Paul &quot;Max&quot; Moga returns as our expert host to help us examine and highlight the stories behind the most strategic and innovative planes. Watch as he analyzes the remarkable technical features and examines the groundbreaking tactics of advanced aerial combat.




12)  F-100 Super Sabre 
In 1953, supersonic flight came of age when the U.S. Air Force received its fleet of F-100 Super Sabres. After four years of development, the F-100 ushered in a new era, breaking both the subsonic and the supersonic world speed records.



